Big Tits In Sports - Juelz Ventura 

Juelz Ventura - Birdie in the Bunker

Added: December 18, 2010

It's golf season, and Juelz needs to practice. After a gruelling workout, she's completely dehydrated. Lucky for her, her caddy, Johnny, always has a fresh bottle of water close by. Golf clubs and water bottles isn't the only thing he's packing though, and he'll use all the &quot;tools&quot; he has to make sure she has a great day of golf.
